import React, { Component } from "react";

class NavBar extends Component {
  render() {
    return (
      <div className="ui blue menu">
        <div className="item">Home</div>
        <div className="item">HighScore</div>
        <div className="item">Log-Out</div>
      </div>
    );
  }
}

export default NavBar;
